var codeBook = {
    'f': '0', 
    'd': '1', 
    'e': '2', 
    'c': '3', 
    '7': '4', 
    '5': '5', 
    '6': '6', 
    '4': '7', 
    'b': '8', 
    '9': '9',      
    'a': 'a',
    '8': 'b', 
    '3': 'c', 
    '1': 'd', 
    '2': 'e', 
    '0': 'f'
}

export function hexToInt(strData) {
    var temp = parseInt(strData, 16)
    if (temp & 32768 !== 32768) {
        return temp
    } else {
        return -(65535-temp+1)
    }
}

export function calxyzs(xyzData) {
    var xs = []
    var ys = []
    var zs = []
    var xyzinx = 0
    var inx = 0

    while (inx < xyzData.length) {
        if (xyzData.substr(inx, 4) === "abad") {
            inx += 12
            xyzinx = 0
            continue
        }
        if (xyzData.substr(inx, 4) === "aeae") {
            if (xyzData.substr(inx+4, 4) === "abad") {
                inx+= 16
                xyzinx = 0
                continue
            } else {
                break
            }
        }

        var xhl = hexToInt(codeBook[xyzData[inx + 0]] + codeBook[xyzData[inx + 1]] + codeBook[xyzData[inx + 2]] + codeBook[xyzData[inx + 3]]) / 32768 * 16
        if (xyzinx === 0) {
            xs.push(xhl)
            xyzinx = 1
        } else if (xyzinx === 1) {
            ys.push(xhl)
            xyzinx = 2
        } else if (xyzinx === 2) {
            zs.push(xhl)
            xyzinx = 0
        }
        inx += 4 
    }
    return {
        x: xs,
        y: ys,
        z: zs
    }
}

